DROP TABLE IF EXISTS CALIBER_ASSOCIATE;
CREATE TABLE IF NOT EXISTS CALIBER_ASSOCIATE (ASSOCIATE_ID INT(11) PRIMARY KEY,ASSOCIATE_FIRST_NAME VARCHAR(256) NOT NULL,ASSOCIATE_LAST_NAME VARCHAR(256) NOT NULL,MARKETING_STATUS_ID INT(11),CLIENT_ID INT(11),END_CLIENT_ID INT(11),BATCH_ID INT(11));
DROP SEQUENCE IF EXISTS ASSOCIATE_ID_SEQUENCE;
CREATE SEQUENCE  IF NOT EXISTS  ASSOCIATE_ID_SEQUENCE  MINVALUE 5600  INCREMENT BY 1 START WITH 5600;



